import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import { LoginPage, AnimeOut } from "./components";
import "./App.css";
function App() {
      return (
        <div>
          <Router>
          <Navigation />
          <Switch>
            <Route path="/" exact component={() => <LoginPage />} />
            <Route path="/log-in" exact component={() => <LoginPage />} />
            <Route path="/main-page" exact component={() => <AnimeOut />} />
          </Switch>
          <Footer />
        </Router>
        </div>
      );
}

export default App;
